    function addLink(){

        if(!document.getElementById('nuke-revive-link')){
            let linkReference = document.querySelector('.links-footer') || document.querySelector('.content-title .clear') || document.querySelector('.tutorial-switcher') || document.querySelector('.links-top-wrap') || document.querySelector('.forums-main-wrap');
            if(linkReference){
                let linkContainer = linkReference.parentNode;
                let newElelemt = document.createElement('span');
                newElelemt.innerHTML = reviveButton;
                linkContainer.insertBefore(newElelemt, linkReference);

                document.getElementById('nuke-revive-link').addEventListener('click', callForRevive);
            }
        }

        setTimeout(addLink, 500);
    }

    function callForRevive(e){
        e.preventDefault;

        let PlayerID = null;
        let PlayerName = null;
        let hospitalIcon = null;
        let factionIcon = null;
        let faction = "";

        let country = document.body.dataset.country;

        let Country = [{
            name: 'mexico',
            title: 'Mexico'
        }, {
            name: 'cayman-islands',
            title: 'Cayman Islands'
        }, {
            name: 'canada',
            title: 'Canada'
        }, {
            name: 'hawaii',
            title: 'Hawaii'
        }, {
            name: 'uk',
            title: 'United Kingdom'
        }, {
            name: 'argentina',
            title: 'Argentina'
        }, {
            name: 'switzerland',
            title: 'Switzerland'
        }, {
            name: 'japan',
            title: 'Japan'
        }, {
            name: 'china',
            title: 'China'
        }, {
            name: 'uae',
            title: 'UAE'
        }, {
            name: 'south-africa',
            title: 'South Africa'
        }, {
            name: 'torn',
            title: 'Torn'
        }].find((destination) => country == destination.name);

        if(!Country){
            Country = {
                name: 'torn',
                title: 'Torn'
            }
        }

        try{
            let uid = getCookie('uid');
            let data = JSON.parse(sessionStorage.getItem('sidebarData' + uid));
            if(data && data.user && data.statusIcons && data.statusIcons.icons){
                PlayerID = uid;
                PlayerName = `${data.user.name} [${uid}]`;
                hospitalIcon = data.statusIcons.icons.hospital;
                factionIcon = data.statusIcons.icons.faction;
            }
            else{
                alert('Error getting player information')
                return;
            }
        }
        catch(error){
            alert('Error getting player information')
            return;
        }

        if(!hospitalIcon){
            alert('You are not in hospital');
            //return;
        }

        if(factionIcon){
            faction = factionIcon.subtitle;
        }

        if(PlayerName){
            var postData = {uid: PlayerID, Player: PlayerName, Faction: faction, Country: Country.title};

            GM_xmlhttpRequest ( {
                method:     'POST',
                url:        'https://www.nukefamily.org/dev/reviveme.php',
                data:       JSON.stringify(postData),
                onload:     function (responseDetails) {
                    // DO ALL RESPONSE PROCESSING HERE...
                    //console.log(responseDetails, responseDetails.responseText);
                    alert(responseDetails.responseText);
                }
            });
        }
    }

    function getCookie(cname) {
        var name = cname + "=";
        var ca = document.cookie.split(';');
        for(var i = 0; i < ca.length; i++) {
            var c = ca[i];
            while (c.charAt(0) == ' ') {
                c = c.substring(1);
            }
            if (c.indexOf(name) == 0) {
                return c.substring(name.length, c.length);
            }
        }
        return "";
    }
